import './App.css';
import Form from './screens/form.js';
import Table from './screens/table';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Form/>
        <div style={{margin:200}}>
          <Table/>
        </div>
      </header>
    </div>
  );
}

export default App;
